  false,\n\t\"url\": null,\n\t\"notes\": \"Regents results by School for all subjects,
  by year.rnrnCohorts of 2001 through 2011 (Classes of 2005 through 2015)rnGraduation
  Outcomes as Calculated by the New York State Education DepartmentrnThe New York
  State calculation method was first adopted for the Cohort of 2001 (Class of 2005).
  \ The cohort consists of all students who first entered 9th grade in a given school
  year (e.g., the Cohort of 2006 entered 9th grade in the 2006-2007 school year).
  \ Graduates are defined as those students earning either a Local or Regents diploma
  and exclude those earning either a special education (IEP) diploma or GED. rnrnIn
  order to comply with FERPA regulations on public reporting of education outcomes,
  rows with a cohort of 20 or fewer students are suppressed.rnDue to the small number
  of students identified as Native American or Multi-Racial, these ethnicities are
  not reported on the Ethnicity tab; however, these students are included in the counts
  on all other tabs.rn4 Year August outcomes are available for the 2004-2011 cohorts
  at the citywide level and for the 2005-2011 cohorts at the borough, district and
  school level. 5 Year August outcomes are available for the 2006-2010 cohorts. Cells
  are blank when data is not available.rnCharter schools are not included in the NYSED
  calculation of graduation rates for NYC.rnSchool level results are not presented
  for District 79 and District 75 schools, but their outcomes are included in citywide
  totals.rnStarting with the 2009 cohort (Class of 2013), students with IEPs could
  use the compensatory score option (CSO) to meet graduation requirements, which contributed
  to an increase in the graduation rate. rnStudents are considered English Language
  Learners by NY State if classified as an ELL as of graduation.\",\n\t\"license_title\":
